Real bir Hekayə,

Şəkildə gördüyünüz şəxslə mən CDL (Profesional Sürücülük Kursları) məktəbində bərabər oxuduq. O zaman heç kimsə bilmirdi məktəbdə ki mən iş adamıyam. Və logistika (logistics ) şirkətim var. Məqsədimdə elə o məktəbdən oxudğumuz tələbələrin icindən komanda yığmaq idi. Ona görə kimsəyə demirdim ki nə iş görürəm, hər kəsi yaxşı tanıyım deyə onlarla çox ic icə oldum. Uzun sözün kısası Kumarla çox gözəl anlaşdıq. Kumar farmasi uzmanı dır İndiada. Görürdüm çox çox gözəl izahı və insanlarla münasibəti var. Bunu özümdə note elədim ki, bu şəxsi birinci carrier (daşıma şirkətimdə) sürücü işləyər sonra bunu özüm acacaöım məktəbə instructor (öyrətmən) olaraq götürərəm. Elədə oldu. Bu şəxs hal hazırda sürücü olaraq işləyir amma Yanvar ayından Allah ın köməkliyi ilə İnstructor olaraq məktəbdə ki tələbələr dərs verəməyə başlayacaqdır. Biznes adamı insanları tanımaq da uzman olmalı və yaxşı dostluqlar qurmalıdır. Dualarınıza hər zaman ehtiyacımız var!

Təşəkkürlər,

@truckmastercdl.school 
@unitedstatestrucks_com 

#fuadaghayev #cdlschool #biznes #insantanıma

Bəzi mövzuları paylaşaraq həyatınıza rəng qatmağa calışıram. Ümüd edirəm ki, hər birinizə zövqlü və marağlıdır.

Ertan Amerikaya 7-8 ay öncə gəlibdir. Türkiyə də ki işini deyib bura da da davam edirəcək (Türkiyədə 11 iıə yaxın avtobus şoferi olubdur) və gələn kimi hazırlaşıb Truck Driver olubdur. Nə xoşbəxtlik ki, bizdə onunla qarşılaşdıq. Şirkətimizdə olan ən yaxşı şoferlərdəndir. Hə birdə Tırdan əlavə olaraqda səhərlər əla mələmən hazırlayır. Ləzzətli olur. Uzun hekayə qısa adamın yeni maşınını təbrik edirik sağlıqla istifadə etməsini arzu edirik.

